import React from 'react';
import '../assets/style/zinebStyle.css'
import {Helmet} from 'react-helmet';

const Signup = () => {

    const [fullname,setFullname] = useState("");
    const [email,setEmail] = useState("");
    const [password,setPassword] = useState("");
    const [phone,setPhone] = useState("");
    const [country,setCountry] = useState("");
    const [city,setCity] = useState("");
    const [address,setAddress] = useState("");

    async function handleSignup(e) {
        e.preventDefault()
        try{
            await Axios.post('http://localhost:3001/register',
            {   fullname: fullname,
                email:email,
                password:password,
                phone:phone,
                country:country,
                city:city,
                address:address
            });
            
        }catch(err){
            msg ="can t create account email must be unique";
            console.log(msg);
        }
    }

    return (
        <>
            <Helmet>
                <style>{'body { background-color: #262936; }'}</style>
            </Helmet>
            <section className="wrapper">
                <div className="content mt-5 py-5">
                    <header>
                        <h1>Sign up</h1>
                    </header>
                    <section>
                        <form onSubmit={handleSignup} className="login-form">
                            <div className="input-group">
                                <label htmlFor="firstName">Full name</label>
                                <input type="text" placeholder="Enter Full name" id="firstName" />
                            </div>
                            <div className="input-group">
                                <label htmlFor="username">Email</label>
                                <input type="email" placeholder="Enter Email" id="username" />
                            </div>
                            <div className="input-group">
                                <label htmlFor="password">Password</label>
                                <input type="password" placeholder="Enter Password" id="password" />
                            </div>
                            <div className="input-group">
                                <label htmlFor="firstName">Phone Number</label>
                                <input type="text" placeholder="Enter Phone Number" id="firstName" />
                            </div>
                            <div className="input-group">
                                <label htmlFor="firstName">Country</label>
                                <input type="text" placeholder="Enter Country" id="firstName" />
                            </div>
                            <div className="input-group">
                                <label htmlFor="firstName">City</label>
                                <input type="text" placeholder="Enter City" id="firstName" />
                            </div>
                            <div className="input-group">
                                <label htmlFor="firstName">Adresse</label>
                                <input type="text" placeholder="Enter Adresse" id="firstName" />
                            </div>
                            <div className="input-group">
                                <button type="submit">Sign up</button>
                            </div>
                        </form>
                    </section>
                    <footer>
                        <a href={`/login`}  title="Login">Already have an account? Login Instead</a>
                    </footer>
                </div>
            </section>


        </>
    );
}

export default Signup;
